import demo1 from "./img/demo1.png";
import demo2 from "./img/demo2.png";
export const products = [
    {
        id: 1,
        img:"https://images.pexels.com/photos/69432/pexels-photo-69432.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500",
        link: "https://github.com/AvinavStha/",
    },
    {
        id: 2,
        img: {demo2},
        link: "https://github.com/AvinavStha/",
    },
    {
        id: 3,
        img:{demo1},
        link: "https://github.com/AvinavStha/",
    },
]
